import Link from 'next/link';
import injectSheet from 'react-jss'

const styles =  {    
  logo: {
    width: '100%',
    textAlign: 'center',
    marginTop: '1rem',
    '& img':{
      position: 'relative',
      width: '100%'
    }
  } 
}

const Header = () => (
<div>
  <div className="logo">
    <Link href="/">
      <a><img src="/img/logo.png"/></a>
    </Link>
  </div>
  <Link href="/" >
    <a>Next</a>
  </Link>
  <Link href="/" >
    <a>Previous</a>
  </Link>
</div>
);

export default injectSheet(styles)(Header);
